import styled from 'styled-components'
import Image from 'next/image'

const HomeContainer = () => {

    return (
        <Container style={{ marginTop: 50 }}>
            <Img>
                <Image
                    src="/videoCall.png"
                    alt="Coding image"
                    layout="intrinsic"
                    height={500}
                    width={500}
                />
            </Img>
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`
const Img = styled(Container)`
    display: flex;
    height: 60%;
    width: 60%;
`

export default HomeContainer
